INSERT INTO `season` VALUES (1,'2021-06-05 00:11:03','2021-06-05 00:11:03','AVES',4,'Aves Season 1',3,'Goldfinch wins the first scoreboard season on a goal diff tiebreaker','HOME_ROTATION'),(2,'2020-04-11 04:00:00','2020-04-11 04:00:00','AVES',8,'Aves Season 2',6,'Oriole wins season 2.','HOME_ROTATION'),(3,'2020-04-21 04:00:00','2020-04-21 04:00:00','AVES',16,'Aves Season 3',8,'Woodpecker wins season 3.','HOME_ROTATION'),(4,'2021-01-27 02:00:52','2021-02-19 00:43:04','AVES',8,'Aves Season 4',1,'Hummingbird and Goldfinch break away from the pack both winning an improbable number of away games. Hummingbird prevails and wins the season losing only 2 games to Goldfinch and 1 to Sparrow.','HOME_ROTATION'),(5,'2021-03-02 20:16:07','2021-04-01 21:33:00','AVES',32,'Aves Season 5',19,'Penguin runs away with Season 5 with an improbable home stand.','HOME_ROTATION'),(6,'2021-04-13 18:01:22','2021-04-16 21:09:18','AVES',4,'Aves Season 6',3,'Goldfinch wins season 6. This was the first season scheduled using the Rounds algorithm.','ROUNDS'),(7,'2021-06-05 00:11:03','2021-06-05 00:11:03','AVES',4,'Aves Season 7',8,'Woodpecker wins season 7. This was the first season played using the react ui. Before this the back end was used by itself.','ROUNDS'),(8,'2021-06-22 08:45:07','2021-06-22 08:47:06','AVES',4,'Aves Season 8',10,'Bluebird wins 3 straight away games and takes season 8. This was the first season where two games were played simultaneously','ROUNDS'),(9,'2021-08-23 02:22:59','2021-08-23 02:22:59','AVES',4,'Aves Season 9',15,'Killdeer was 1-5-1 25% through the games, but made a remarkable comeback going 14-2-1 from that point, and winning 8 of their last 9 to finish. Purple Martin seemed to be in the driver\'s seat for most of the competition, but lost their last 5 taking themselves out of the running. Mockingbird hung around the whole way and lead briefly, but had a lot of away games towards the end and couldn\'t keep up with Killdeer. Morning Dove started strong at 4-1-0, but completely collapsed from that point and finished 15 points off the lead. This was the last of 4 seasons of the schedule type ROUNDS featuring the front half of the league in their groups of 4.','ROUNDS'),(10,'2021-10-05 01:56:09','2021-11-04 15:24:00','AVES',8,'Aves Season 10',7,'This was the first seaon with type ROUNDS with 8 teams. Robin captures their first season winning their last 5 games and going 5-0 at home. It ended in dramatic fashion with Robin and Oriole playing each other in the final round tied at 14 points. The winner take all game went into overtime where Robin scored to take season 10.','ROUNDS'),(11,'2021-11-01 17:42:35','2021-11-01 17:42:35','AVES',8,'Aves Season 11',9,'Canary starts 6-0 (5 of those home wins) gaining a 3 point lead on 2nd place, but then loses 2 and ends up tied with Mockingbird with 2 games to go. Canary wins in round 9, while Mockingbird loses clinching Canary\'s season 11 win.','ROUNDS'),(12,'2022-01-18 04:28:13','2022-01-18 04:28:13','AVES',16,'Aves Season 12',12,'This was the first season scheduled with HOME_ROTATION_RANDOM which made it very hard to tell which teams were doing well. This was also the first season played after implementing the Game Events feature making it easier to keep track of when goals were scored in the game. Blue Jay started hot winning their first 7 games, which included a comeback from 5-1 down in the third period. They appeared to fade off and several other teams seemed to have an equal or better chance to take the season. The most notable challenger was Woodpecker who one 12 of 13 at one point. Woodpecker\'s Point Percentage was 81.3% when Blue Jay\'s was 68.4%. The race was on between those two teams down the stretch. Neither team finished strong but Blue Jay was better and finished on top in Season 12.','HOME_ROTATION_RANDOM'),(13,'2022-09-12 06:00:22','2022-09-24 00:54:59','AVES',8,'Aves Season 13',21,'Flamingo!','HOME_ROTATION_RANDOM');
